import SignUp from "./SignUp";
import Login from "./Login";

function Profile() {
    return (
        <div className='Profile'>

            <div> <h1> Welcome to Your Profile page, choose your action </h1>
                <button> SignUp </button>
                <SignUp />
                <Login />
            </div>
        </div>
    )
}

export default Profile;
